    render(){
        return(
            <div>
                <form>
                <div>
                        Post Name:<br/>
                        <input type="text" name="post" />                        

                    </div><br/>

                    <div>
                        Category:<br/>
                        <input type="text" name="category" />                        

                    </div><br/>

                    <div>
                        post:<br/>
                        <input type="file" name="file" />                        

                    </div><br/>

                    <div>

                        <input type="submit" name="category" value="upload" />                        

                    </div>

                </form>
            </div>
        )
    }
}
